import { Injectable } from '@angular/core';
import { HttpClient, HttpHeaders } from '@angular/common/http';
import { Observable, ObservableInput, catchError, tap } from 'rxjs';
import { Couriers } from './Couriers';
import { PriceResult } from './PriceResult';



@Injectable({
  providedIn: 'root'
})
export class CouriersService {


  private httpOptions = {
    headers: new HttpHeaders({
      'Content-Type': 'application/json; charset=utf-8',
      'Authorization': 'bearer example',
      'Access-Control-Allow-Origin': '*',
      'Access-Control-Allow-Methods': '*',
      'Access-Control-Allow-Headers': '*'
    }),
    withCredentials: false
  };


  apiUrl: string = "https://localhost:44340/";
    handleError: ((err: any, caught: Observable<PriceResult>) => ObservableInput<any>) | undefined;
  constructor(private http: HttpClient) { }


  checkPrice(courier: Couriers): Observable<any> {
    const headers = { 'content-type': 'application/json' }
    //const body = JSON.stringify(courier);
    //console.log(body)
    //return this.http.post(this.apiUrl + 'PageUPCouriers', body, { 'headers': headers })

    const body = JSON.stringify(courier);
    //const httpOptions = { headers: new HttpHeaders({ 'Content-Type': 'application/json' }) };
    return this.http.post<any>(this.apiUrl + 'PageUPCouriers', body, { 'headers': headers });

    //return this.http.post<PriceResult>(this.baseURL + 'PageUPCouriers', body, { 'headers': headers }).pipe(
    //  tap(data => console.log(JSON.stringify(data))));
  }


  //checkPrice(courier: Couriers): Observable<PriceResult> {
  //  return this.http.post<PriceResult>(this.baseURL, courier, this.httpOptions).pipe(
  //    tap(data => console.log(JSON.stringify(data))),
  //    catchError("error")
  //  );
  //}


}
